def parseArgs(args, aliases={}):

    rc = {}

    while len(args) > 0 and args[0].startswith('-'):
        opt = args.pop(0)
        if opt == '--':
            break # ignore and exit

        # treat options with one dash the same as those with two dashes
        if opt.startswith('--'):
            opt = opt[2:]
        elif opt.startswith('-'):
            opt = opt[1:]

        equalsPos = opt.find('=')
        val = None
        if equalsPos >= 0:
            val = opt[equalsPos+1:]
            opt = opt[:equalsPos]

        rc[opt] = val

    return rc

