def delta_to_slurm_time(tdelta):

    d = {"days": tdelta.days}
    d["hours"], rem = divmod(tdelta.seconds, 3600)
    d["minutes"], d["seconds"] = divmod(rem, 60)
    if tdelta.days == 0:
        as_string = "{hours}:{minutes}:{seconds}".format(**d)
    else:
        as_string = "{days}-{hours}:{minutes}:{seconds}".format(**d)
